import React from "react";

const Results = ({ measurements }) => {
  if (!measurements) return <p>No measurements yet. Start the camera!</p>;

  return (
    <div className="results">
      <h3>Body Measurements</h3>
      <ul>
        <li>Shoulder: {measurements.shoulderOutput}</li>
        <li>Waist: {measurements.waist}</li>
        <li>Arm Length: {measurements.leftArmLength}</li>
      </ul>
      <h3>Recommended Size</h3>
      <p>Top: {measurements.chest > 90 ? "L" : "M"}</p>
      <p>Bottom: {measurements.waist > 80 ? "L" : "M"}</p>
    </div>
  );
};

export default Results;
